name = sys.stdin.readline()
total = 0
prev = 0
for c in name:
	curr = ord(c) - 97
	if curr != -87:
		forward = math.fabs(curr - prev)
		if(prev < 13):
			abs_prev = prev
		else:
			abs_prev = 26 - prev
		if(curr < 13):
			abs_curr = curr
		else:
			abs_curr = 26 - curr
		backward = abs_prev + abs_curr
		#print(forward, backward, prev, curr)
		if(forward > backward):
			total += backward
		elif(backward >= forward):
			total += forward
	prev = curr

print(total)

