def main():
	stdin = sys.stdin.read()
	embosser_moves(stdin)

def embosser_moves(word):
	word = 'a' + word
	total = 0

	for ind in range(1, len(word)):
		diff = ord(word[ind-1]) - ord(word[ind])

		if diff < 0:
			diff += 26

		if diff >= 13:
			diff = abs(26 - diff)

		total += diff

	print(total)

if __name__ == '__main__':
	main()

import sys

def main():
	print(power(1378, int(sys.stdin.readline()), mod=10))

def power(a, n, mod):
	cur_power = a
	ans = 1

	for i in range(32):
		if n & (1 << i):
			ans *= cur_power

		cur_power *= cur_power
		cur_power %= mod

	ans %= mod

	return ans


