def main():
    s, x = map(int, input().split())
    if s < x:
        print(0)
        return
    s, x = ([c == '1' for c in bin(int(_))[2:]] for _ in (s, x))
    x = [False] * (len(s) - len(x)) + x
    a, b = [False] * len(s), [False] * len(s)

    def deeper(idx, carry):
        if idx:
            idx -= 1
            if carry:
                if s[idx] == x[idx]:
                    return
                if s[idx]:
                    deeper(idx, False)
                    a[idx] = True
                    b[idx] = True
                    deeper(idx, True)
                    a[idx] = False
                    b[idx] = False
                else:
                    b[idx] = True
                    deeper(idx, True)
                    b[idx] = False
            else:
                if s[idx] != x[idx]:
                    return
