def compute():

    def xgcd(b,n):
        x0, x1, y0, y1 = 1, 0, 0, 1
        while n!=0:
            q, b, n = b//n, n, b%n
            x0, x1 = x1, x0 - q*x1
            y0, y1 = y1, y0 - q*y1
        return b, x0, y0

    A, B, C = map(int,input().split())
    if A==0 and B==0:
        return [-1] if C!=0 else [0,0]
    if A==0:
        return [0, -C//B] if abs(-C)%B==0 else [-1]
    if B==0:
        return [-C//A, 0] if abs(-C)%A==0 else [-1]
    g, x, y = xgcd(A,B)
    if abs(-C)%g!=0:
        return [-1]
    d = -C//g
    return [x*d, y*d]

