        x0, x1, y0, y1 = 1, 0, 0, 1
        while n!=0:
            q, b, n = b//n, n, b%n
            x0, x1 = x1, x0 - q*x1
            y0, y1 = y1, y0 - q*y1
        return b, x0, y0

    A, B, C = map(int,input().split())
    g, x, y = xgcd(A,B)
    if abs(-C)%g!=0:
        return -1
    d = -C//g
