import math
def dist(arr1, arr2):
    x1 = arr1[0]
    y1 = arr1[1]
    x2 = arr2[0]
    y2 = arr2[1]
    x1x2 = math.pow(abs(x1 - x2), 2)
    y1y2 = math.pow(abs(y1 - y2), 2)
    distance = math.pow(x1x2 + y1y2, 0.5)
    return distance


def getneighbours(loc):
    x1= loc[0]
    y1 = loc[1]
    neighbours = [[x1 + 1, y1], [x1 - 1, y1], [x1, y1 + 1], [x1, y1 -1], [x1 + 1, y1 + 1], [x1 - 1, y1 - 1], [x1+1, y1-1], [x1-1, y1 + 1]]
    for i in neighbours:
        for k in i:
            if k > 8 or k < 1:
                if i in neighbours:
                    neighbours.remove(i)
    return neighbours



