    f = 0
    for i in range(2,int(n**.5)+1):
        if n%i == 0:
            f = 1
            break
    return f
    
def prime(n):
    pri = []
    m = 1
    p = 1
    while m<=n:
        p = p + 1
        if is_pri(p) == 0:
            pri.append(p)
            m = m+1
        
    return pri



