def reverse(s):
    if s < 10:
        s = "0{}".format(s)
    else:
        s = str(s)
    return int(s[::-1])

def main(s):
    hh, mm = [int(item) for item in s.split(':')]

    if hh == 23 and mm > 32:
        return 60 - mm
    elif (16 <= hh <= 19) or (hh == 15 and mm > 51):
        return (20 - hh) * 60 + 2 - mm
    elif (6 <= hh <= 9) or (hh == 5 and mm > 50):
        return (10 - hh) * 60 + 1 - mm
    elif reverse(hh) >= mm:
        return reverse(hh) - mm
    else:
        return reverse(hh + 1) + 60 - mm

