def findans(s,ans,start,parent):
    if start >= len(s): return
    if start + 1 < len(s):
        toadd = s[start:start+2]
        if toadd != parent:
            ans.add(toadd)
            if (start+2,2) not in memo:
                findans(s, ans, start + 2,toadd)
                memo[(start+2,2)] = 1

    if start + 2 < len(s):
        toadd = s[start:start+3]
        if toadd != parent:
            ans.add(toadd)
            if (start+3,3) not in memo:
                findans(s, ans, start + 3,toadd)
                memo[(start+3,3)] = 1



