import sys

def bins(arr, key):
    lo = 0
    hi = len(arr) - 1

    while lo < hi:
        mid = lo + (hi - lo) // 2
        if(key > arr[mid]):
            lo = mid + 1
        else:
            hi = mid
    if(arr[hi] == key):
        return hi

    return hi - 1

