def vectors(k):
    vs = [1]
    m = 1
    for i in range(k):
        s = (1<<i)
        vs_ = []
        for v in vs:
            u = v<<s
            vs_.append(u | v)
            vs_.append(u | (~v & m))
        vs = vs_
        m = (m<<s) | m
    return vs


def print_vector(k, v):
    b = bin(v)[2:].zfill(2**k)
    print(b.translate(str.maketrans('10', '+*')))


if __name__ == '__main__':
    k = int(input())
    for v in vectors(k):
        print_vector(k, v)

from functools import reduce
from itertools import islice, product
from operator import mul


def prod(iterable, start=1):
    return reduce(mul, iterable, start)


def isqrt(n):
    x, px, nx = 0, 0, n
    while nx not in (x, px):
        px, x = x, nx
        nx = (x + (n//x))//2
    return min(x, nx)


