def rotateClockwise(grid):
	if grid[0][0] == 'X':
		(grid[0][0], grid[1][0]) = (grid[1][0], grid[0][0])
	elif grid[0][1] == 'X':
		(grid[0][0], grid[0][1]) = (grid[0][1], grid[0][0])
	elif grid[1][0] == 'X':
		(grid[1][0], grid[1][1]) = (grid[1][1], grid[1][0])
	else:
		(grid[0][1], grid[1][1]) = (grid[1][1], grid[0][1])

