def isValid(s):
	positions = set()
	prev = None
	current = (0, 0)
	positions.add(current)
	for c in s:
		if c == 'L':
			next = left(current)
		elif c == 'R':
			next = right(current)
		elif c == 'U':
			next = up(current)
		elif c == 'D':
			next = down(current)
		else:
			assert(False)
		if next == prev:
			return False
		prev = current
		current = next
		positions.add(current)
		# check if all 4 directions for a cycle
		count = 0
		if left(current) in positions:
			count += 1
		if right(current) in positions:
			count += 1
		if up(current) in positions: 
			count += 1
		if down(current) in positions:
			count += 1
		if count > 1:
			return False
	return True

