def div(num):
    div=[]
    if num==1:
        div.append(1 )
    else:
        for i in range (1,num//2+1):
            if num%i==0:
                div.append(i)
                if num//i not in div:
                    div.append(num//i)
    return div
def cdiv(n1,n2):
    cd=[]
    for i in div(n1):
        if i in div(n2) and i not in cd:
            cd.append(i)
    return cd
