def is_palindrome(string):
    if string == string[::-1]:
        return True
    return False


def delete_trash(string):
    for char in string:
        if char.isnumeric():
            string += char
    return string


def get_hours(_time):
    if _time[0] == '0':
        _x = _time[1]
    else:
        _x = int(str(_time[0] + _time[1]))
    return int(_x)


