from sys import stdin
def quick(n):
    if len(n)==0:
        return n
    piv=n[len(n)//2]
    mi,me,ma=[],[],[]
    for i in range(len(n)):
        if n[i]<piv:
            mi.append(n[i])
        elif n[i]>piv:
            ma.append(n[i])
        elif n[i]==piv:
            me.append(n[i])
    return quick(ma)+me+quick(mi)
