def quickSort(lst):
    if len(lst) <= 1: 
        return lst
    smaller = [x for x in lst[1:] if x < lst[0]]
    larger = [x for x in lst[1:] if x >= lst[0]]
    return quickSort(larger) + [lst[0]] + quickSort(smaller)
def main():
    x=int(stdin.readline().strip())
