def sum_digits(n):
    sum = 0
    for i in range(n + 1):
        sum += i
    return sum

def list_need_digits(numb):
    count, lst = 1, []
    while sum_digits(count) <= numb:
        lst.append(count)
        count += 1
    if sum_digits(count) != numb:
        lst[len(lst) - 1] += numb - sum_digits(count - 1)
    return lst 

