def before_light(l, d, v, g, r):
    min_time_to_light = d / v
    light_color = int(min_time_to_light) % (g + r)
    if light_color < g:
        return min_time_to_light
    else:
        return int(min_time_to_light / (g + r) + 1) * (g + r)


def after_light(l, d, v, g, r):
    return (l - d) / v


def solve():
    l, d, v, g, r = map(int, input().split())
    minimum_time = str(round(after_light(l, d, v, g, r) + before_light(l, d, v, g, r), 10))
    print(minimum_time)


solve()

def before_light(l, d, v, g, r):
    min_time_to_light = d / v
    light_color = int(min_time_to_light) % (g + r)
    if light_color < g:
        return min_time_to_light
    else:
        return min_time_to_light + g + r - light_color


def after_light(l, d, v, g, r):
    return (l - d) / v


