			if h[i] >= 0:
				return False
		return True
	else:
		if h[left - 1] < 0 and h[left] < 0 and left + 2 != n:
			if dfs(step, left + 1, mx):
				return True
		else:
			if left >= mx:
				h[left - 1] -= b; h[left] -= a; h[left + 1] -= b
				ans[step] = left
				if dfs(step - 1, left, left):
					return True
				h[left - 1] += b; h[left] += a; h[left + 1] += b
			if left + 1 >= mx and left + 1 < n - 1:
				h[left] -= b; h[left + 1] -= a; h[left + 2] -= b
				ans[step] = left + 1
				if dfs(step - 1, left, left + 1):
					return True
				h[left] += b; h[left + 1] += a; h[left + 2] += b

		return False

