def first_win(mapp):
	if "XXX" in mapp:
		return True
	for i in range(3):
		if mapp[0][i]=="X" and mapp[1][i]=="X" and mapp[2][i]=="X":
			return True
	if mapp[0][0]=="X" and mapp[1][1]=="X" and mapp[2][2]=="X":
		return True
	elif mapp[0][2]=="X" and mapp[1][1]=="X" and mapp[2][0]=="X":
		return True
	return False

def second_win(mapp):
	if "000" in mapp:
		return True

	for i in range(3):
		if mapp[0][i]=="0" and mapp[1][i]=="0" and mapp[2][i]=="0":
			return True
	if mapp[0][0]=="0" and mapp[1][1]=="0" and mapp[2][2]=="0":
		return True
	elif mapp[0][2]=="0" and mapp[1][1]=="0" and mapp[2][0]=="0":
		return True
	return False


