def distancia_euclidiana(x, y):
    lados = []
    lados.append(math.pow(x[0] - x[1], 2) + math.pow(y[0] - y[1], 2))
    lados.append(math.pow(x[0] - x[2], 2) + math.pow(y[0] - y[2], 2))
    lados.append(math.pow(x[1] - x[2], 2) + math.pow(y[1] - y[2], 2))
    return sorted(lados)


