def main():
    walk = {
        'L': (0, -1),
        'U': (-1, 0),
        'R': (0, +1),
        'D': (+1, 0)
    }
    back = {
        'L': 'R',
        'R': 'L',
        'U': 'D',
        'D': 'U'
    }

    def update(pos, d):
        nonlocal walk
        return (
            pos[0]+walk[d][0],
            pos[1]+walk[d][1]
        )

    def check(path):
        vis = set()
        pos = (0, 0)
        vis.add(pos)

        for c in path:
            pos = update(pos, c)

            for nei in 'LURD':
                if nei != back[c] and update(pos, nei) in vis:
                    return False

            vis.add(pos)

        return True

    path = input()

    print('OK' if check(path) else 'BUG')

