def compute_sets(a, b, k):
    if not(a >= k or b >= k):
        return -1

    awins = a // k
    bwins = b // k

    if awins == 0:
        if b % k != 0:
            return -1

    elif bwins == 0:
        if a % k != 0:
            return -1

    return awins + bwins


