        yield 26 + i

def count_hacks():
    p, x, y = input().split(' ')
    p = int(p)
    x = int(x)
    y = int(y)

    current_winners = list(winners_list(x))
    if x >= y and p in current_winners:
        return 0

    mix = x
    for _ in range(x // 50):
        mix -= 5
        current_winners_minus_50  = list(winners_list(mix))
        if mix >= y and p in current_winners_minus_50:
